    <div className='w-[100%] bg-cover h-96 grid justify-center content-center mt-1 p-10 quote-border justify-self-center'>
      <p className='text-4xl text-black'> Quotes from the quoter, about a quotable thing </p>
      <p className='text-sm text-right'> - quoter </p>
    </div>
  )
}
